"original": |2-
     This REQUIRED Printer attribute identifies the set of supported
     compression algorithms for Document data.  Compression only applies
     to the Document data; compression does not apply to the encoding of
     the IPP operation itself.  The supported values are used to validate
     the Client-supplied "compression" operation attributes in Print-Job
     and Send-Document requests.
"fixed": |-
  This REQUIRED Printer attribute identifies the set of supported compression algorithms for Document data.  Compression only applies to the Document data; compression does not apply to the encoding of the IPP operation itself.  The supported values are used to validate the Client-supplied "compression" operation attributes in Print-Job and Send-Document requests.
"ko": |-
  이 필수 프린터 속성은 문서 데이터에 대해 지원되는 압축 알고리즘 세트를 식별합니다. 압축은 문서 데이터에만 적용됩니다. 압축은 IPP 작업 자체의 인코딩에는 적용되지 않습니다. 지원되는 값은 인쇄 작업 및 문서 보내기 요청에서 클라이언트 제공 "압축" 작업 속성의 유효성을 검사하는 데 사용됩니다.
